import React,{Component} from "react";
import ReactDOM from "react-dom";


class MarineTrafficMap extends Component {
  componentDidMount() {
    const script = document.createElement("script");
    script.async = true;
    script.src = "http://www.marinetraffic.com/js/embed.js";
    document.body.appendChild(script);
  }
  render() {
    return (
        <div className="google-map-code">
          <iframe src="http://www.marinetraffic.com/js/embed.js" width="600" height="450" frameborder="0" style={{border:0}} allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
        </div>
    );
  }
}

export default MarineTrafficMap;
